import React from "react";
import { Carousel } from "react-responsive-carousel";

export default () => (
  <Carousel autoPlay>
  <div>
  <img src="https://assets.bonappetit.com/photos/5c2e5aa8441ed72d95964cf7/16:9/w_2056,c_limit/Roasted-Winter-Squash-with-Kale-Pipian.png" />
  </div>
  <div>
  <img src="https://media.self.com/photos/57ed7db0a10da17b66f2e570/4:3/w_728,c_limit/colorful-meal.jpg" />
  </div>
  </Carousel>
);
